  "[正文稿]关于印发《重庆市巴南区党内关怀办法（修订）》的通__知.txt": "1. 关怀对象主要包括三类党员：党龄40年及以上的农村老党员和未享受城镇养老保险或离退休待遇的城镇老党员；年龄在80周岁及以上且党龄55年及以上的老党员；生活特别困难的党员。\n2. 敬老补助标准根据党龄不同分为三档：党龄40-49年每月100元，50-54年每月120元，55年及以上每月150元。"
}

